import React, { useState, useEffect } from "react";
import Table from "react-bootstrap/Table";
const ApplicationList = () => {
  let [applications, setApplications] = useState([]);

  useEffect(() => {
    getApplications();
  }, []);

  let getApplications = async () => {
    let response = await fetch("http://127.0.0.1:8000/api/applications/");
    let data = await response.json();
    console.log(data.Response.Items);
    let new_data = data.Response.Items;
    // console.log(data)
    console.log(new_data);
    setApplications(new_data);
  };
  return (
    <div>
      <Table  responsive>
        <thead>
          <tr>
            <th><strong>Application Id</strong></th>
            <th><strong>Application Name</strong></th>
            <th><strong>CompanyName</strong></th>
            <th><strong>Application Href</strong></th>
          </tr>
        </thead>
        <tbody hover>
          {applications.map((application, index) => {
            return (
              <tr key={index}>
                <td> {application.Id}</td>
                <td> {application.Name}</td>
                <td> {application.CompanyName}</td>
                <td> {application.Href}</td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    </div>
  );
};

export default ApplicationList;
